import React from 'react';
import { Link } from 'react-router-dom';
import { Nav } from "tabler-react";

class Navbar extends React.Component {
    constructor(props){
        super(props)
        this.onClick = this.props.onClick;
    }

    render() {
        return (
            <Nav
            items={
            <React.Fragment>
                <Nav.Item active to="/overview" value="Overview" icon="globe"/>
                <Nav.Item LinkComponent='<Link to="/wallet"/>' value="Wallet" icon="credit-card">
                </Nav.Item>
                
                <Nav.Item value="Profile" icon="user" />
                <Nav.Item value="Logout" onClick={() => this.onClick()} icon="log-out"/>
            </React.Fragment>
            }
        />);
    }
}

export default Navbar;
